import {link} from 'react-router-dom';

class TableRow extends Component{

   render(){

    return(
    
      <tr>
         <td>
           {this.props.obj.name}  
         </td> 

         <td>
          {this.props.obj.packId}     
        </td>  

        <td>
          {this.props.obj.destination}     
        </td> 


        <td>
          {this.props.obj.numofdays}     
        </td>   

        <td>
          {this.props.obj.nopass}     
        </td> 


        <td>
          {this.props.obj.hotel}     
        </td> 


        <td>
          {this.props.obj.transport}     
        </td> 

        <td>
          {this.props.obj.tourGuide}     
        </td> 

        <td>
          {this.props.obj.totPrice}     
        </td> 

        <td>
        
         <button className="btn btn-primary">Delete</button>
        </td> 
         <td>
         <button className="btn btn-primary">Delete</button>   
        </td> 




      </tr>

   



    

  


    );



   }





}

export default TableRow;
